import React, { Component } from 'react';
import Home from "./home";
import Navbar from "./Navbar";
import Footer from "./Footer";
import { BrowserRouter as Router, Route } from "react-router-dom";
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Router>
          <Navbar/>
          <Home/>
          <Footer/>
        </Router>
      </div>
    );
  }
}

export default App;
